SELECT 'CREATE DATABASE swtp'
WHERE NOT EXISTS (SELECT FROM pg_database WHERE datname = 'swtp');

ALTER DATABASE "swtp" OWNER TO "db_controller";

CREATE TABLE "users"
(
    u_id              BIGSERIAL PRIMARY KEY,
    username          VARCHAR(30) NOT NULL,
    email             VARCHAR(64) NOT NULL,
    password          VARCHAR(60) NOT NULL,
    is_verified       BOOLEAN     NOT NULL DEFAULT FALSE,
    gets_notified     BOOLEAN     NOT NULL DEFAULT FALSE,
    cards_per_session INTEGER     NOT NULL DEFAULT 20,
    lang_code         VARCHAR(3)  NOT NULL DEFAULT 'EN',

    CONSTRAINT unique_email UNIQUE (email)
);

CREATE TABLE "image"
(
    i_id       BIGSERIAL PRIMARY KEY,
    image_data bytea  NOT NULL,
    user_id    BIGINT,

    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE
);


CREATE TABLE "user_login_tracker"
(
    ult_id  BIGSERIAL PRIMARY KEY,
    date    TIMESTAMP NOT NULL,
    user_id BIGINT    NOT NULL,

    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE
);

CREATE TABLE "token_type"
(
    tt_id SERIAL PRIMARY KEY,
    type  VARCHAR(64) NOT NULL,

    CONSTRAINT unique_token_type UNIQUE (type)
);

INSERT INTO token_type
VALUES (1, 'VERIFICATION');
INSERT INTO token_type
VALUES (2, 'PASSWORD_RESET');
INSERT INTO token_type
VALUES (3, 'SHARE_DECK');

CREATE TABLE "user_token"
(
    ut_id            BIGSERIAL PRIMARY KEY,
    token_value      VARCHAR(50) NOT NULL,
    expiry_timestamp TIMESTAMP   NOT NULL,
    token_type       INTEGER     NOT NULL,
    user_id          BIGINT      NOT NULL,

    CONSTRAINT unique_token_value UNIQUE (token_value),

    FOREIGN KEY (token_type) REFERENCES token_type (tt_id),
    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE
);

CREATE TABLE "achievement"
(
    a_id        SERIAL PRIMARY KEY,
    name        VARCHAR(128) NOT NULL,
    description TEXT         NOT NULL,
    is_daily    BOOLEAN      NOT NULL DEFAULT FALSE,
    image_id    BIGINT       NOT NULL,

    CONSTRAINT unique_name UNIQUE (name),
    FOREIGN KEY (image_id) REFERENCES image (i_id) ON DELETE CASCADE
);

CREATE TABLE "user_achievements"
(
    ua_id          BIGSERIAL PRIMARY KEY,
    user_id        BIGINT    NOT NULL,
    achievement_id INTEGER   NOT NULL,
    achieved_at    TIMESTAMP NOT NULL,

    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE,
    FOREIGN KEY (achievement_id) REFERENCES achievement (a_id)
);

CREATE TABLE "deck"
(
    d_id     BIGSERIAL PRIMARY KEY,
    name     VARCHAR(128) NOT NULL,
    owner_id BIGINT       NOT NULL,

    FOREIGN KEY (owner_id) REFERENCES users (u_id) ON DELETE CASCADE
);

CREATE TABLE "card_type"
(
    ct_id SERIAL PRIMARY KEY,
    type  VARCHAR(64) NOT NULL,

    CONSTRAINT unique_card_type UNIQUE (type)
);

INSERT INTO card_type
VALUES (1, 'BASIC');
INSERT INTO card_type
VALUES (2, 'MULTIPLE_CHOICE');

CREATE TABLE "card"
(
    c_id         BIGSERIAL PRIMARY KEY,
    question     TEXT    NOT NULL,
    image_id     BIGINT,
    deck_id      BIGINT  NOT NULL,
    card_type_id INTEGER NOT NULL,

    FOREIGN KEY (image_id) REFERENCES image (i_id) ON DELETE CASCADE,
    FOREIGN KEY (deck_id) REFERENCES deck (d_id) ON DELETE CASCADE,
    FOREIGN KEY (card_type_id) REFERENCES card_type (ct_id)
);

CREATE TABLE "text_answer_card"
(
    c_id     BIGINT PRIMARY KEY,
    answer   TEXT NOT NULL,
    image_id BIGINT,

    FOREIGN KEY (c_id) REFERENCES card (c_id) ON DELETE CASCADE,
    FOREIGN KEY (image_id) REFERENCES image (i_id) ON DELETE CASCADE
);

CREATE TABLE "multiple_choice_card"
(
    c_id BIGINT PRIMARY KEY,

    FOREIGN KEY (c_id) REFERENCES card (c_id) ON DELETE CASCADE
);

CREATE TABLE "choice_answer"
(
    ca_id      BIGSERIAL PRIMARY KEY,
    answer     TEXT    NOT NULL,
    is_correct BOOLEAN NOT NULL,
    image_id   BIGINT,
    c_id       BIGINT  NOT NULL,

    FOREIGN KEY (image_id) REFERENCES image (i_id) ON DELETE CASCADE,
    FOREIGN KEY (c_id) REFERENCES multiple_choice_card (c_id) ON DELETE CASCADE
);

CREATE TABLE "status_type"
(
    st_id SERIAL PRIMARY KEY,
    type  VARCHAR(64) NOT NULL,

    CONSTRAINT unique_status_type UNIQUE (type)
);

INSERT INTO status_type
VALUES (1, 'NOT FINISHED');
INSERT INTO status_type
VALUES (2, 'FINISHED');
INSERT INTO status_type
VALUES (3, 'CANCELED');

CREATE TABLE "learn_session"
(
    ls_id       BIGSERIAL PRIMARY KEY,
    created_at  TIMESTAMP NOT NULL,
    finished_at TIMESTAMP,
    rating_1    INTEGER   NOT NULL DEFAULT 0,
    rating_2    INTEGER   NOT NULL DEFAULT 0,
    rating_3    INTEGER   NOT NULL DEFAULT 0,
    rating_4    INTEGER   NOT NULL DEFAULT 0,
    rating_5    INTEGER   NOT NULL DEFAULT 0,
    rating_6    INTEGER   NOT NULL DEFAULT 0,
    status_id   INTEGER   NOT NULL,
    deck_id     BIGINT    NOT NULL,
    user_id     BIGINT    NOT NULL,

    FOREIGN KEY (status_id) REFERENCES status_type (st_id),
    FOREIGN KEY (deck_id) REFERENCES deck (d_id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE
);

CREATE TABLE "peek_session"
(
    ps_id       BIGSERIAL PRIMARY KEY,
    created_at  TIMESTAMP NOT NULL,
    finished_at TIMESTAMP,
    status_id   INTEGER   NOT NULL,
    deck_id     BIGINT    NOT NULL,
    user_id     BIGINT    NOT NULL,

    FOREIGN KEY (status_id) REFERENCES status_type (st_id),
    FOREIGN KEY (deck_id) REFERENCES deck (d_id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE
);


CREATE TABLE "peek_session_cards"
(
    psc_id          BIGSERIAL PRIMARY KEY,
    card_id         BIGINT NOT NULL,
    peek_session_id BIGINT NOT NULL,

    FOREIGN KEY (card_id) REFERENCES card (c_id) ON DELETE CASCADE,
    FOREIGN KEY (peek_session_id) REFERENCES peek_session (ps_id) ON DELETE CASCADE
);

CREATE TABLE "repetition"
(
    r_id                 BIGSERIAL PRIMARY KEY,
    repetition           INTEGER   NOT NULL,
    quality              INTEGER   NOT NULL,
    prev_ease_factor     FLOAT     NOT NULL,
    prev_interval        INTEGER   NOT NULL,
    user_id              BIGINT    NOT NULL,
    card_id              BIGINT    NOT NULL,
    next_learn_timestamp TIMESTAMP NOT NULL,

    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE,
    FOREIGN KEY (card_id) REFERENCES card (c_id) ON DELETE CASCADE
);

CREATE TABLE "rainbow"
(
    r_id     BIGSERIAL PRIMARY KEY,
    password VARCHAR(60) NOT NULL,

    CONSTRAINT unique_password UNIQUE (password)
);

CREATE TABLE "tutorial_page_type"
(
    tpt_id SERIAL PRIMARY KEY NOT NULL,
    type    VARCHAR(32) NOT NULL
);

CREATE TABLE "user_tutorial_page"
(
    utp_id               BIGSERIAL PRIMARY KEY NOT NULL,
    user_id              INTEGER    NOT NULL,
    tutorial_page_type_id     BIGINT    NOT NULL,

    FOREIGN KEY (user_id) REFERENCES users (u_id) ON DELETE CASCADE,
    FOREIGN KEY (tutorial_page_type_id) REFERENCES tutorial_page_type (tpt_id) ON DELETE CASCADE
);

